import PySimpleGUI as sg

#sg.theme_previewer()

sg.theme('Dark2')   # Add a touch of color
# All the stuff inside your window.

strike_bk_on_hlt_on = b''
strike_bk_off_hlt_on = b''
strike_bk_on_hlt_off = b''
strike_bk_off_hlt_off = b''
mash_in_bk_on_hlt_on = b''
mash_in_bk_on_hlt_off = b''
mash_in_bk_off_hlt_on = b''
mash_in_bk_off_hlt_off = b''
mash_blue_hlt_on_rc_on = b''
mash_yellow_hlt_on_rc_on = b''
mash_yellow_hlt_off_rc_on = b''
mash_yellow_hlt_on_rc_off = b''
mash_yellow_hlt_off_rc_off = b''

gifs = [strike_bk_on_hlt_on, strike_bk_off_hlt_on, strike_bk_on_hlt_off, strike_bk_off_hlt_off, mash_in_bk_on_hlt_on, mash_in_bk_on_hlt_off, mash_in_bk_off_hlt_on, mash_in_bk_off_hlt_off, mash_blue_hlt_on_rc_on, mash_yellow_hlt_on_rc_on, mash_yellow_hlt_off_rc_on, mash_yellow_hlt_on_rc_off, mash_yellow_hlt_off_rc_off]

layout = [  [sg.Text('', size=(17,1)), sg.Text('150 F', font='Courier 30', size=(13,1)), sg.Text('142 F', font='Courier 30', size=(19,1)), sg.Text('167 F', font='Courier 30', size=(10,1))],
            [sg.ProgressBar(1000, orientation='v', size=(50, 20), pad=(1,(1,160)), key='progressbar'), sg.Image(data=gifs[0], key='_IMAGE_'), sg.ProgressBar(1000, orientation='v', size=(50, 20), pad=(1,(1,160)), key='progressbar')],
            [sg.Button('Ok'), sg.Button('Cancel')] ]

# Create the Window
window = sg.Window('Brewery UI', layout)
# Event Loop to process "events" and get the "values" of the inputs
offset = 0
gif = gifs[0]
while True:
    event, values = window.read(100)
    window['_IMAGE_'].update_animation(gif,  time_between_frames=200)
    if event == sg.WIN_CLOSED or event == 'Cancel': # if user closes window or clicks cancel
        break
    elif event == 'Ok':
        offset += (offset < len(gifs)-1)        # add 1 until the last one
        gif = gifs[offset] 
        window['_IMAGE_'].update_animation(gif,  time_between_frames=200)